import { makeStyles } from '@material-ui/core/styles'
import { ViewState, EditingState } from '@devexpress/dx-react-scheduler'
import { 
    Scheduler,  
    WeekView,
    Appointments, 
    AppointmentTooltip,
    DragDropProvider,
    EditRecurrenceMenu,
    AllDayPanel,
} from '@devexpress/dx-react-scheduler-material-ui'

const Availability = ({employeeAvailability}) => {
    const currentDate = new Date()

    return (
            <Scheduler
                data={employeeAvailability}
                firstDayOfWeek={1}
            >
                <ViewState
                    defaultCurrentDate={currentDate}
                />
                <WeekView
                    startDayHour={6}
                    cellDuration={120}
                    endDayHour={24}
                />

                <Appointments />
                <AppointmentTooltip 
                    showCloseButton
                />
                <AllDayPanel />
            </Scheduler>
    )
}

export default Availability
